		/// 0<br/>
		/// 2. &gt; current_frame -up<br/>
		/// 1<br/>
		/// &gt; report_frames<br/>
		/// 0 : f<br/>
		/// -&gt; 1 : t<br/>
		/// 2 : /top/Initial18_0<br/>
		/// 3. &gt; current_frame -down<br/>
		/// 0<br/>
		/// &gt; report_frames<br/>
		/// -&gt; 0 : f<br/>
		/// 1 : t<br/>
		/// 2: /top/Initial18_0<br/>
		/// 4. &gt; current_frame -set 1<br/>
		/// 1<br/>
		/// &gt; report_frames<br/>
		/// 0 : f<br/>
		/// -&gt; 1 : t<br/>
		/// 2 : /top/Initial18_0<br/>
