		/// <summary>
		/// <para>
		/// Run SSN analysis on the current package and pinout<br/>
		/// </para>
		/// <br/>
		/// <br/>
		/// TCL Syntax: report_ssn [-name &lt;arg&gt;] [-return_string] [-format &lt;arg&gt;] [-file &lt;arg&gt;] [-append] [-phase] [-quiet] [-verbose]
