		/// get_parts -filter "FAMILY == [get_property FAMILY [get_property PART \<br/>
		/// [current_project]]] &amp;&amp; SSN_REPORT"<br/>
		/// </para>
		/// <br/>
		/// <para>
		/// See ug835-vivado-tcl-commands.pdf, page 1442<br/>
		/// </para>
